description:
Mighty GirlzMG - Aug 28, 2012 - Brandi Aniston



Mp4 + Pics



She has found herself ensnared in a trap unlike any that she has been in before... And she struggles mightily to seemingly no avail. Enraged, Leather demands to be freed, she demands to know her captors identity. Her futile yells have not fallen on deaf ears...Fuzz bombs are activated, sending her into a deep state of unconsciousness. With Leather down, her captors emerge from the shadows...With motives unclear, Leather is further restrained, and upon awakening, she embarks upon the struggle of a lifetime in hopes of avoiding what surely must be an insidious ploy



